// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract NFTMetaverse {
    uint256 public cost;
    uint256 public maxSupply;
    mapping(address => uint256) public totalSupply;
    mapping(uint256 => House) public houses;

    struct House {
        address owner;
        bool exists;
    }

    House[] public houseList;

    event HouseMinted(uint256 houseId, address owner);

    constructor(uint256 _cost, uint256 _maxSupply) {
        cost = _cost;
        maxSupply = _maxSupply;
    }

    function mint() public payable {
        require(msg.value >= cost, "Insufficient payment");
        require(totalSupply[msg.sender] < maxSupply, "Max supply reached");

        House storage newHouse = houses[houseList.length];
        newHouse.owner = msg.sender;
        newHouse.exists = true;
        houseList.push(newHouse);

        totalSupply[msg.sender]++;

        emit HouseMinted(houseList.length - 1, msg.sender);
    }

    function getHouseOwner(uint256 houseId) public view returns (address) {
        require(houseId < houseList.length, "Invalid house ID");

        House storage house = houses[houseId];
        require(house.exists, "House does not exist");

        return house.owner;
    }
}
